import React from 'react'
import User from '../core/User'

export default class UserMapper extends React.Component {
    static convertToUser(json) {
        return new User(
            json.id,
            json.userInfos.firstName,
            json.userInfos.lastName,
            json.userInfos.age,
            json.todayScore
        )
    }
}
